import React, { Component } from 'react';
import BillingAmount from './BillingAmount';

class BillingSection extends Component {
    render() {
        return (
            <section className='billingSection'>
                <BillingAmount {...this.props}/>
            </section>
        )
    }
}

export default BillingSection
